import React from 'react';
import {useState, useEffect} from 'react';
import Axios from 'axios';
import Navigation from '../components/Navigation';
import Footer from '../components/Footer';
import LoginDataTable from '../components/LoginDataTable';
import SearchBar from '../components/SearchBar';

function ViewAll() {

  const [logins, setLogins] = useState([]);
  const [search, setSearch] =useState([])

  const loadLogins = async () => {
    const response = await Axios.get("http://localhost:4500/view-all");
    const data = await response.data;
    console.log(data)
    setLogins(data);
} 

  function build_array(logins){
    name_aray = []
    logins.map((login) => name_aray.push(login))
    return(
      console.log(name_aray)
    )
  }

  useEffect(() => {
      loadLogins(setLogins);
  }, []);

  return (
    <div>
      <Navigation />
      <div className ="main-content">
        <div className="block-container">
          <div className="block-container-inner">
            <div className="form-field-container">
              <h3>View All</h3>
              <LoginDataTable logins= {logins}></LoginDataTable>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  )
}

export default ViewAll
